MapController::MapController(void)
{

}

MapController::MapController(string levelName)
{
	loadLevel(levelName);
	loadTileset();
}

void MapController::loadTileset()
{
	for (int i = 1; i <= 10; i++){
		tileset[i] = loadTileImage(i);
	}
}

int MapController::intFromString(string s){
	if (s == "0"){
		return 0;
	}
	if (s == "1"){
		return 1;
	}
	if (s == "2"){
		return 2;
	}
	if (s == "3"){
		return 3;
	}
	if (s == "4"){
		return 4;
	}
	if (s == "5"){
		return 5;
	}
	if (s == "6"){
		return 6;
	}
	if (s == "7"){
		return 7;
	}
	if (s == "8"){
		return 8;
	}
	if (s == "9"){
		return 9;
	}
	if (s == "g"){
		return 10;
	}
	return 0;
}

